101.body:
Seleciona elementos que possuem um atributo class específico. As classes são precedidas por um ponto (.): HTML: <p class="destaque">Este parágrafo tem destaque.</p>
<p>Este parágrafo é normal.</p>
<p class="destaque">Este parágrafo também tem destaque.</p> CSS: .destaque { color: red; font-weight: bold;
}

102.body:
Seleciona um elemento único que possui um atributo id específico. IDs são precedidos por uma cardinal (#): HTML: <p id="introducao">Este é o parágrafo de introdução.</p>
<p>Este é um parágrafo normal.</p> CSS: #introducao { color: green; font-size: 20px;
} IMPORTANTE : Cada ID deve ser único numa página HTML. Se precisar de aplicar o mesmo estilo a múltiplos elementos, utilize classes.

103.body:
É possível combinar seletores para criar regras mais específicas: /* Seleciona todos os parágrafos dentro de um div */
div p { color: gray;
} /* Seleciona parágrafos que têm a classe "especial" */
p.especial { background-color: yellow;
} /* Seleciona elementos com classe "botao" que também têm classe "primario" */
.botao.primario { background-color: blue; color: white;
}

