112.body:
/* Especificidade: 100 (ID) + 10 (classe) + 2 (2 elementos) = 112 */
#header ul.menu li { color: blue;
}
/* Especificidade: 10 (classe) + 2 (2 elementos ) = 12 */
ul.menu li { color: red;
} Cálculo de Especificidade para os seletores “#header ul.menu li” e “ul.menu li” Se aplicarmos estes estilos a um elemento HTML como: <div id="header"> <ul class="menu"> <li>Item 1</li> <li>Item 2</li> </ul>
</div> O texto dos itens da lista será azul , pois a regra com ID tem uma especificidade maior (112) do que a regra com classe (12).

