97.body:
Uma regra CSS é composta por várias partes: seletor { propriedade: valor; propriedade: valor;
} Estrutura de uma regra CSS Exemplo prático: p { color: red; font-size: 16px; margin: 10px;
} Componentes: Seletor (p): Define qual elemento HTML será afetado Chaves ({}): Delimitam o bloco de declarações Propriedade (color, font-size, margin): Define que aspeto será modificado Valor (red, 16px, 10px): Define como a propriedade será aplicada Ponto e vírgula (;): Separa cada declaração NOTA : O ponto e vírgula é obrigatório no final de cada declaração, exceto na última declaração de um bloco (embora seja recomendado incluí-lo sempre).
